import React, { useEffect } from 'react';
import $ from 'jquery';
import './estilospurosestilos.css'

const ExampleComponent = () => {
  useEffect(() => {
    const handleLinkClick = (e) => {
      e.preventDefault();
      const target = $(e.target).attr('href');
      const offset = $(target).offset().top - 120;
      $('body, html').animate({
        scrollTop: offset
      }, 1000);
    };
  
    $('.component-link').click(handleLinkClick);
  
    return () => {
      $('.component-link').off('click', handleLinkClick);
    };
  }, []);

  return (
    <div className="page-top">
      <header className="header">
        <a className="logo" href=".page-top"> Johan C</a>
        <input className="menu-btn" type="checkbox" id="menu-btn" />
        <label className="menu-icon" htmlFor="menu-btn"><span className="navicon"></span></label>
        <ul className="menu">
        <li><a href="#one" className="link link-theme link-arrow component-link">HOME</a></li>
<li><a href="#two" className="link link-theme link-arrow component-link">SERVICE</a></li>
<li><a href="#three" className="link link-theme link-arrow component-link">ABOUT US</a></li>
<li><a href="#four" className="link link-theme link-arrow component-link">CONTACT</a></li>
        </ul>
      </header>
      </div>
       
      );
}

export default ExampleComponent;
